setTimeout(() => {
  aaa = false;
}, 1000);

ReactDOM.render(
  <React.StrictMode>
    <Timmer num={5} />
    <TimmerOver isOver={aaa} />
  </React.StrictMode>,

  document.getElementById("root")
);
